-------------------- Create SEQUENCE section  
CREATE SEQUENCE Rider_ID_Seq    START WITH 3000074;
CREATE SEQUENCE Discount_ID_Seq START WITH 2;
CREATE SEQUENCE vehicle_id_Seq  START WITH 40;
CREATE SEQUENCE Payment_ID_Seq  START WITH 85;
CREATE SEQUENCE Driver_ID_Seq   START WITH 100035;
CREATE SEQUENCE Bank_Account_ID_Seq;
CREATE SEQUENCE Ride_ID_Seq     START WITH 4;




-------------------- Create TABLE section 
CREATE TABLE Rider
(
    Rider_ID                NUMBER          default Rider_ID_Seq.NEXTVAL PRIMARY KEY  ,
    First_Name              VARCHAR(30)     NOT NULL,
    Last_Name               VARCHAR(30)     NOT NULL,
    Email                   VARCHAR(40)     NOT NULL,
    Phone                   CHAR(12)        NOT NULL,
    Address                 VARCHAR(40)     NOT NULL,
    City                    VARCHAR(30)     NOT NULL,
    Zip                     CHAR(5)         NOT NULL,
    CONSTRAINT Rider_Email_Unique UNIQUE  (Email),
    CONSTRAINT Rider_Email_Length_Check CHECK (LENGTH(Email) >= 7)
);


CREATE TABLE Discounts
(
    Discount_ID             NUMBER          DEFAULT Discount_ID_Seq.NEXTVAL PRIMARY KEY,
    Rider_ID                NUMBER          NOT NULL references RIDER(rider_id),
    Discount_Type           VARCHAR(20)     NOT NULL,
    Discount_Percent        NUMBER          NOT NULL,
    Used_Flag               CHAR(1)         DEFAULT 'N' NOT NULL,
    Expiration_Date         DATE            DEFAULT SYSDATE + 30 NOT NULL,
    CONSTRAINT Discounts_Used_Flag_Check CHECK (Used_Flag='Y' OR Used_Flag='N')
);


CREATE TABLE Rider_Payment (
  Payment_ID            NUMBER  DEFAULT Payment_ID_Seq.NEXTVAL PRIMARY KEY,
  Rider_ID              NUMBER  REFERENCES Rider(Rider_ID),
  Cardholder_First_Name VARCHAR(50),
  Cardholder_Mid_Name   VARCHAR(50),
  Cardholder_Last_Name  VARCHAR(50),
  CardType              CHAR(4),
  CardNumber            CHAR(16),
  Expiration_Date       DATE,
  CC_ID                 CHAR(3),
  Billing_Address       VARCHAR(50),
  Billing_City          VARCHAR(50),
  Billing_State         CHAR(2),
  Billing_Zip           CHAR(5),
  Primary_Card_Flag     CHAR(1)
);


CREATE TABLE Vehicle
(
    Vehicle_ID              NUMBER          DEFAULT Vehicle_ID_Seq.NEXTVAL PRIMARY KEY,
    Year                    NUMBER(4)       NOT NULL,
    Make                    VARCHAR(30)     NOT NULL,
    Model                   VARCHAR(50)     NOT NULL,
    Color                   VARCHAR(30)     NOT NULL,
    VIN                     CHAR(17)        NOT NULL,
    Plate_Num               CHAR(7)     NOT NULL,
    Insurance_Company       CHAR(5)     NOT NULL,
    Insurance_Policy_Num    VARCHAR(20)     NOT NULL,
    Inspection_Exp_Date     DATE            NOT NULL,
    CONSTRAINT Vehicle_Plate_Num_Unique UNIQUE (Plate_Num),
    CONSTRAINT Vehicle_VIN_Unique UNIQUE (VIN)
);


CREATE TABLE Driver
(
    Driver_ID                   NUMBER          DEFAULT Driver_ID_Seq.NEXTVAL PRIMARY KEY,
    First_Name                  VARCHAR(30)     NOT NULL,
    Last_Name                   VARCHAR(30)     NOT NULL,
    Address                     VARCHAR(50)     NOT NULL,
    City                        VARCHAR(30)     NOT NULL,
    State                       CHAR(2)         NOT NULL,
    Zip                         CHAR(5)         NOT NULL,
    Phone                       CHAR(12)        NOT NULL,
    Email                       VARCHAR(50)     NOT NULL,
    DOB                         DATE            NOT NULL,
    Drivers_License_Num         CHAR(8)         NOT NULL,
    Rides_Given                 NUMBER          DEFAULT 0 NOT NULL,
    CONSTRAINT Driver_Email_Unique UNIQUE (Email),
    CONSTRAINT Driver_Drivers_License_Num_Unique UNIQUE (Drivers_License_Num),
    CONSTRAINT Driver_Email_Length_Check CHECK (LENGTH(Email) >= 7)
);

 
CREATE TABLE Bank_Account
(
    Bank_Account_ID         NUMBER          DEFAULT Bank_Account_ID_Seq.NEXTVAL PRIMARY KEY,
    Driver_ID               NUMBER          NOT NULL REFERENCES DRIVER(DRIVER_ID),
    Routing_Number          CHAR(9)         NOT NULL,
    Account_Number          VARCHAR(20)     NOT NULL,
    CONSTRAINT Bank_Account_Driver_ID_Unique UNIQUE (Driver_ID)
);


CREATE TABLE Vehicle_Driver_Linking
(
    Driver_ID               NUMBER          NOT NULL references DRIVER(Driver_ID),
    Vehicle_ID              NUMBER          NOT NULL references VEHICLE(Vehicle_ID),
    Active_Vehicle_Flag     CHAR(1)         NOT NULL,
    CONSTRAINT Vehicle_Driver_Linking_Pk PRIMARY KEY (Driver_ID, Vehicle_ID),
    CONSTRAINT V_D_Linking_Active_Vehicle_Check CHECK (Active_Vehicle_Flag in ('Y','N')) 
);

 


CREATE TABLE Ride
(
    Ride_ID             NUMBER       DEFAULT Ride_ID_Seq.NEXTVAL PRIMARY KEY,
    Driver_ID           NUMBER       NOT NULL REFERENCES DRIVER(DRIVER_ID),
    Rider_ID            NUMBER       NOT NULL REFERENCES RIDER(RIDER_ID),
    Vehicle_ID          NUMBER       NOT NULL REFERENCES VEHICLE(VEHICLE_ID),
    Pickup_Address      VARCHAR(50)  NOT NULL,
    Dropoff_Address     VARCHAR(50)  NOT NULL,
    Request_Datetime    DATE         DEFAULT SYSDATE NOT NULL,
    Start_Datetime      DATE,
    End_Datetime        DATE,
    Initial_Fare        NUMBER(5,2),
    Discount_Amount     NUMBER(5,2),
    Final_Fare          NUMBER(5,2),
    Rating              NUMBER(1),
--    CONSTRAINT Ride_Start_End_Check CHECK (Start_Datetime < End_Datetime),
    CONSTRAINT Ride_Final_Fare_Check CHECK (Final_Fare = Initial_Fare - Discount_Amount)
);


